landingPage.selectUserAccount();
landingPage.clickDOTAsset();
cy.readFile('cypress/fixtures/savedData.json').then(({
  totalBorrowed,
  totalSupplied,
  currentBalance
}) => {
  let balanceWallet = parseFloat(currentBalance);
  let valueSupplied = parseFloat(totalSupplied);
  let valueBorrowed = parseFloat(totalBorrowed);
  let collateralFactor = parseFloat(Cypress.env('collateralFactor'));
  let priceDOT = parseFloat(Cypress.env('priceDOT'));
  let borrowLimit = valueSupplied * priceDOT * collateralFactor - valueBorrowed * priceDOT;
  let totalCollateral = valueSupplied * priceDOT * collateralFactor;
  let borrowLimitUsed = valueBorrowed * priceDOT / totalCollateral * 100;
  borrowLimitUsed = borrowLimitUsed.toFixed(2);
  assetPageDOT.clickSuplyBtn();
  cy.goToPopUp();
  cy.wait(1000);
  assetPageDOT.enterAmountSupply(this.data.supplyDOT_50000);
  cy.wait(3000);
  assetPageDOT.checkEstimatedGasFee(this.data.gasFeeSupplyDOT);
  let balanceWalletCurr = balanceWallet.toString().replace('.', ',');
  assetPageDOT.checkWalletBalance(`${balanceWalletCurr}`);
  assetPageDOT.checkBorrowLimit(`${borrowLimit}`);
  assetPageDOT.checkBorrowLimitUsed(`${borrowLimitUsed}`);
  assetPageDOT.clickConfirmSupply();
  cy.wait(6000);
});
